function moreButtonOn(a,b){a.color="#040b25";a.backgroundColor="white";b.display="block"}function moreButtonOff(a,b){a.color="";a.backgroundColor="";b.display="none"}moreMenuOnclickHandler=function(a,b){return function(){if(b.display!=="none"){moreButtonOff(a,b)}else{moreButtonOn(a,b)}}};function setupMoreMenu(){var a=document.getElementById("show_navbar").querySelector("a").style;var b=document.getElementById("navbar_more").style;moreButtonOff(a,b);document.getElementById("show_navbar").onclick=moreMenuOnclickHandler(a,b)}function executeMobileJavascript(){var b=document.getElementsByClassName("text_link");for(var a=0;a<b.length;a++){b[a].className+=" mobile"}}function triggerFadeIn(){var b=document.getElementsByClassName("fade_in");for(var a=0;a<b.length;a++){b[a].className+=" fading_in"}}function lazyLoadImages(){var a=document.getElementsByClassName("lazy_load_image");for(var c=0;c<a.length;c++){var d=a[c];for(var b=0;b<d.childNodes.length;b++){if(d.childNodes[b].className=="img"){var e=d.childNodes[b];e.setAttribute("src",d.getAttribute("data-src"));e.onload=function(){for(var f=0;f<this.parentNode.childNodes.length;f++){if(this.parentNode.childNodes[f].className=="loading_text"){this.parentNode.childNodes[f].className+=" loaded"}}}}}}}function runJavascript(){if("ontouchstart" in window){executeMobileJavascript()}setupMoreMenu();window.onload=function(){triggerFadeIn();lazyLoadImages()}}runJavascript();